import { Component } from 'react'

class HomePageMain extends Component{
    render(){
        return(
            <div className='HomePageMain'>
                <div className='Title'>
                    <h1>Your AdressBook</h1>
                </div>
                <div className='HomePageDescription'>
                    <h1>Welcome to Your AdressBook here you can add, delete, and keep up with old contacts that you have. All one hundred percent secure and with auto back-up will backup to all your devices.</h1>
                </div>
                <div className='HomePageButtons'>
                   <button>Sign Up</button> 
                   <button>Sign In</button> 
                </div>
            </div>
        )
    }
}

export default HomePageMain
